;; **
;;; # Exploring the FRED Economic data API
;; **

;; @@
(ns fred-worksheet
  (:require [gorilla-plot.core :as plot]
            [simple-time.core :as stime]
            [clojure.pprint :refer [pprint]]
            [fcfredapi.fred :as fred]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(defn- fix-value-str
  [v]
  (if (number? v)
    v
    (try 
      (Float. v)
      (catch NumberFormatException e
        nil))))

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;fred-worksheet/fix-value-str</span>","value":"#'fred-worksheet/fix-value-str"}
;; <=

;; @@
(defn augment-gdp
  [dat]
  (-> dat
             (update-in [:observations] 
                    (fn [v] (doall (map #(assoc % :rtdt (stime/parse (:realtime_start %) "yyyy-MM-dd")) v))))
             (update-in [:observations] 
                    (fn [v] (doall (map #(assoc % :datedt (stime/parse (:date %) "yyyy-MM-dd")) v))))
             
             (update-in [:observations] 
                    (fn [v] (doall (map #(update-in % [:value] fix-value-str) v))))
             ))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;fred-worksheet/augment-gdp</span>","value":"#'fred-worksheet/augment-gdp"}
;; <=

;; @@
(defn elapsed-days
  [dt]
  (stime/timespan->total-days (stime/- dt (stime/datetime 1970 01 01))))

(defn elapsed-weeks
  [dt]
  (double (/ (stime/timespan->total-days (stime/- dt (stime/datetime 1970 01 01))) 7)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;fred-worksheet/elapsed-weeks</span>","value":"#'fred-worksheet/elapsed-weeks"}
;; <=

;; @@
(def gdp (augment-gdp
           	(fred/get-series "GDPC1" :params {:realtime_start "1776-07-04"})))
(def gdp-now (augment-gdp
               (fred/get-series "GDPC1")))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;fred-worksheet/gdp-now</span>","value":"#'fred-worksheet/gdp-now"}
;; <=

;; @@
(def obs (:observations gdp))
(def obs-now (:observations gdp-now))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;fred-worksheet/obs-now</span>","value":"#'fred-worksheet/obs-now"}
;; <=

;; @@
(def ggdp (group-by :date (:observations gdp)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;fred-worksheet/ggdp</span>","value":"#'fred-worksheet/ggdp"}
;; <=

;; @@
(plot/histogram (map :value obs-now))
